{"0": ["Полная хрень", "2021-05-06T19:19:16Z", "серо-коричневый", "0", 0, 1, 1, "Щетка для вычесывания шерсти домашних животных ", "MARKETHOT"], "1": ["Во первых она пришла позже. Во вторых место расчёски положили детскую игру.", "2021-01-16T14:05:30Z", "серо-коричневый", "0", 1, 2, 1, "Щетка для вычесывания шерсти домашних животных ", "MARKETHOT"], "2": ["Забрали заказ, дома обнаружили что этой расчёски нет, заказ оплачен, а в профиле отмечено что выдан", "2020-11-28T09:34:11Z", "серо-коричневый", "0", 3, 2, 1, "Щетка для вычесывания шерсти домашних животных ", "MARKETHOT"], "3": ["Щётка г.... полное. Не успела даже немного вычесать, сели тут же батарейки, и не чешет ни сколько.", "2020-08-14T19:22:30Z", "серо-коричневый", "0", 9, 1, 1, "Щетка для вычесывания шерсти домашних животных ", "MARKETHOT"], "4": ["Абсолютно бесполезная вещь.  у меня овчарка шерсть не берёт совсем чуть-чуть.", "2018-10-25T11:37:45.48954453Z", "серо-коричневый", "0", 20, 2, 1, "Щетка для домашних животных для счесывания шерсти", "MARKETHOT"], "6": ["Отвратительное качество, работает через раз и не выполняет свои функции. Шерсть просто наматывается на расческу.", "2019-05-13T18:50:09.400085426Z", "серо-коричневый", "0", 15, 1, 1, "Щетка для домашних животных для счесывания шерсти", "MARKETHOT"], "7": ["Не поверила предыдущим отзывам, заказала и зря. Не вычесывает ни собаку ни кошку. Можно использовать как обычную расчёску.", "2019-03-11T18:20:00.403138323Z", "серо-коричневый", "0", 14, 1, 1, "Щетка для домашних животных для счесывания шерсти", "MARKETHOT"], "8": ["Бесполезная покупка. Собака боится шума работающих ножей и уходит - невозможно вычесыаать. также надо очень сильно тянуть на себя шерсть, чтобы запутавшаяся часть попала в ножи. Не пользуемся, можно выбрасывать.", "2018-12-09T20:32:34.60381087Z", "серо-коричневый", "0", 16, 2, 1, "Щетка для домашних животных для счесывания шерсти", "MARKETHOT"]}
